import React from 'react';
import { connect } from 'react-redux';
import { selectCollectionById } from '../../redux/shop/shop.selectors'; 
const CategoryPage = ({ collections, match }) => { 
    return <div className='collection-page'>
      {
          collections.items.forEach(element => { 
          return <h1>{element.name}</h1>
          })
      }
    </div>
}

const mapStateToProps = (state, ownProps) => ({
    collections: selectCollectionById(ownProps.match.params.collectionId)(state)
});

export default connect(mapStateToProps)(CategoryPage);
